window.bookSummaryJSON = "<p><b>Two broken hearts find love and healing in each other in this sexy contemporary romance spin-off from the </b><b><i>New York Times </i></b><b>best-selling author of the Rock Chick and Dream Man series.</b></p> <p>Evie is a bona fide nerd and a hyperintelligent chick who has only ever been able to rely on herself. So when she decides to earn an engineering degree, she takes a job dancing at Smithie's club to make the tuition money she needs. But between her lack of dancing skills and an alpha bad boy who becomes overly protective, Evie realizes this gig might not be as easy as she thought.</p> <p>Daniel \"Mag\" Magnusson knows a thing or two about pain, but the mask he wears is excellent. No one can tell that this good-looking, quick-witted, and roguish guy has deep-seated issues. Mag puts on a funny-guy routine so he can hide his broken heart and PTSD. But when Evie dances her way into Mag's life, he realizes that he needs to come face-to-face with the demons of his past if he wants a future with her.</p>"; 
